import React from 'react';
import { Nav, NavbarContainer, Span, NavLogo, NavItems, GitHubButton, ButtonContainer, MobileIcon, MobileMenu, MobileLink } from './NavbarStyledComponent';
import { DiCssdeck } from 'react-icons/di';
import { FaBars } from 'react-icons/fa';
import { Bio } from '../../data/constants';
import { useTheme } from 'styled-components';
import { Link } from 'react-router-dom';

const Navbar = () => {
  const [isOpen, setIsOpen] = React.useState(false);
  const theme = useTheme();

  const handleMobileMenuToggle = () => {
    setIsOpen(!isOpen);
  };

  return (
    <Nav>
      <NavbarContainer>
        {/* Using Link instead of anchor tag for proper SPA routing */}
        <NavLogo>
          <Link to="/" style={{ display: "flex", alignItems: "center", color: "white", marginBottom: '20px', cursor: 'pointer' }}>
            <DiCssdeck size="3rem" />
            <Span>Portfolio</Span>
          </Link>
        </NavLogo>

        {/* Mobile Menu Toggle Icon */}
        <MobileIcon onClick={handleMobileMenuToggle}>
          <FaBars />
        </MobileIcon>

        {/* Navigation Items */}
        <NavItems>
          <Link to="#about">
            <NavLink>About</NavLink>
          </Link>
          <Link to="#skills">
            <NavLink>Skills</NavLink>
          </Link>
          <Link to="#experience">
            <NavLink>Experience</NavLink>
          </Link>
          <Link to="#projects">
            <NavLink>Projects</NavLink>
          </Link>
          <Link to="#education">
            <NavLink>Education</NavLink>
          </Link>
        </NavItems>

        {/* GitHub Button */}
        <ButtonContainer>
          <GitHubButton href={Bio.github} target="_blank">Github Profile</GitHubButton>
        </ButtonContainer>

        {/* Mobile Menu */}
        {isOpen && (
          <MobileMenu isOpen={isOpen}>
            <MobileLink href="#about" onClick={handleMobileMenuToggle}>About</MobileLink>
            <MobileLink href="#skills" onClick={handleMobileMenuToggle}>Skills</MobileLink>
            <MobileLink href="#experience" onClick={handleMobileMenuToggle}>Experience</MobileLink>
            <MobileLink href="#projects" onClick={handleMobileMenuToggle}>Projects</MobileLink>
            <MobileLink href="#education" onClick={handleMobileMenuToggle}>Education</MobileLink>
            <GitHubButton style={{ padding: '10px 16px', background: `${theme.primary}`, color: 'white', width: 'max-content' }} href={Bio.github} target="_blank">Github Profile</GitHubButton>
          </MobileMenu>
        )}
      </NavbarContainer>
    </Nav>
  );
}

export default Navbar;
